pragma solidity ^0.8.0;

interface ICollectionList {
  struct Collection {
    uint id;
    string name;
    uint chainId;
    address token;
    uint accessThresholdInCollectionTokens;
    uint activityThresholdInSNK;
    uint lockPeriodInSeconds;
    uint revshareInPercents;
