    uint depositedSNK;
    bool active;
    uint lockedAt;
    bool depositsEnabled;
  }

  event CollectionAdded(uint collectionId);
  event SNKDeposited(uint collectionId, address depositor, uint amount, bool newStatus);
  event SNKWithdrawn(uint collectionId, address depositor, uint amount, bool newStatus);
  event DepositsReleased(uint collectionId, uint releasedCount, uint remainingCount);
  event CollectionRemoved(uint collectionId);

  function addCollection(
    string calldata name,
    uint chainId,
    address token,
    uint accessThresholdInCollectionTokens,
    uint activityThresholdInSNK,
    uint lockPeriodInSeconds,
    uint revshareInPercents,
    address payable revshareRecipient
  ) external;

  function removeCollection(uint collectionId) external;
  function setLock(uint collectionId) external;
  function setName(uint collectionId, string memory name) external;
  function setChainId(uint collectionId, uint chainId) external;
  function setToken(uint collectionId, address token) external;
  function setAccessThresholdInCollectionTokens(uint collectionId, uint accessThresholdInColectionTokens) external;
  function setActivityThresholdInSNK(uint collectionId, uint activityThresholdInSNK) external;
  function setRevshareRecipient(uint collectionId, address payable revshareRecipient) external;
  function setRevshareInPercents(uint collectionId, uint revshareInPercents) external;
  function setLockPeriodInSeconds(uint collectionId, uint lockPeriodInSeconds) external;
  function depositSNK(uint collectionId, uint amount) external;
  function withdrawSNK(uint collectionId) external;
  function getCollectionCount() external view returns (uint);
  function getCollections(uint startIdx, uint endIdx) 
    external view returns(Collection[] memory);
  function getPauserRole() external pure returns(bytes32);
  function isActive(uint collectionId) external view returns(bool);
  function getRevshareRecipient(uint collectionId) external view returns(address payable);
  function getRevshareInPercents(uint collectionId) external view returns(uint);
  function releaseDeposits(uint collectionId, uint count) external;
  function getDepositRecordCount(uint collectionId) view external returns(uint);
  function toggleDepositAccepting(uint collectionId) external; 

